const TabelPengunjung = (props) => {
    const {data} = props;


    return (
        <div>
            <thead>
                <tr>Nama</tr>
                <tr>Umur</tr>
                <tr>Jenis Kelamin</tr>
                <tr>Aksi</tr>
            </thead>

            <tbody>
                <tr></tr>
            </tbody>
        </div>
    )
}

export default TabelPengunjung;
